import React from "react";
import { Switch, Route } from "react-router-dom";
import HeaderFooter from "./components/HeaderFooter";
import "./App.css";
import UserPage from "./pages/UserPage";

function App() {
	return (
		<>
			<Switch>
				<Route exact path="/" component={HeaderFooter} />
				<Route exact path="/top" component={HeaderFooter} />
				<Route exact path="/best-stories" component={HeaderFooter} />
				<Route exact path="/user/:userId" component={UserPage} />
			</Switch>
		</>
	);
}

export default App;
